  owner: string
  address: string
}

@Component({
  selector: 'app-root',
  templateUrl: './app.component.html',
  styleUrls: ['./app.component.css']
})
export class AppComponent {
  public owner = " "
  public address = " "
  public propertyListing: IPropertyListing[] = []


  addProperty() {
    this.propertyListing.push({
      owner: this.owner,
      address: this.address
    })
    this.owner = ''
    this.address = ''
  }
}
